    var tn = new Date().getTime();



		this.msgCount++;

		//this.cl("ap iter...");
		this.hdm = hdm;
		this.delta = this.deg360delta(this.hdm, this.target) ;
		this.storeIt("ap3Delta", this.delta, this.min1 );


