  // mMapVal( ui.value, 0, 180, -90,90 )
  mMapVal( val, minI, maxI, minO, maxO, inLimits = false){
    var dI = maxI - minI;
    var dO = maxO - minO;
    var nI = ( val - minI )/dI;

    if( inLimits ){
      var tr = minO + ( nI*dO );
      if( tr < minO )
        return minO;
      else if( tr > maxO )
        return maxO;
      else
        return tr;

    }else
      return minO + ( nI*dO );

  }


